import * as React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import {FC} from "react";
import {BoxTeam} from "./BoxTeam";
import {BoxMetric} from "./BoxMetric";
import {BoxRelease} from "./BoxRelease";
import {BoxComponent} from "./BoxComponent";

interface BoxProps {
    title: string;
    description: string;
    type: string;
    id: string;
}

export const Box: FC<BoxProps> = (props) => {
    const { type } = props;

    switch (type) {
        case 'team': return <BoxTeam {...props} />
        case 'metric': return <BoxMetric {...props} />
        case 'release': return <BoxRelease {...props} />
        case 'component': return <BoxComponent {...props} />
        default: return null
    }

};
